const IMAGES = {
  SAVE: 'data:image/png;base64,',
  DELETE:
    'data:image/png;base64,'
}

const FORM_HANDLERS = {
  onClick: event => {
    // get text from child node
    let text = this.childNodes[0].textContent

    // turn the child node into a text area with the text
    // that the old element held
    this.innerHTML = '<textarea>' + text + '</textarea>'

    // remove the original onclick event so that the user
    // can click the element
    this.onclick = null

    // force focus so that the user can type immediately
    // without having to reclick the element
    this.childNodes[0].focus()
  },
  focusOut: event => {
    // get text from the text area
    let text = event.target.value

    // replace the text area with a span and apply the
    // typed text to the span
    event.target.outerHTML = '<span>' + text + '</span>'

    //re-assign onclick handler
    this.onclick = FORM_HANDLERS.onClick
  },
  keyUp: event => {
    if (event.keyCode === 13) {
      let text = event.target.value
      event.target.outerHTML = '<span>' + text + '</span>'
      this.onclick = FORM_HANDLERS.onClick
    }
  },
  addRow: event => {
    let cell = document.getElementById('add-row-cell').childNodes[0]
    let text = cell.textContent.trim()
    cell.textContent = ' '
    let tbody = document.getElementById('qdo-exclusions')
    cleanChildNodes(tbody)

    // verify that this name isn't already listed
    // maybe verify against a data table when one is added in

    let inputcells = document.getElementsByClassName('input-cell')
    for (let i = 0; i < inputcells.length; i++) {
      let child = inputcells[i].childNodes[0]
      if (text.toUpperCase() === child.textContent.trim().toUpperCase()) {
        alert(text + ' is already in the exclusion list.')
        return
      }
    }

    // add name in if not listed already
    let rowNum = tbody.childNodes.length + 1
    tbody.innerHTML =
      tbody.innerHTML +
      '<tr> <th>' +
      rowNum.toString() +
      "</th> <td class='input-cell'><span>" +
      text +
      "</span></td> <td> <button  class='delete-row-button'> <img src='" +
      deleteImage +
      "' /> </button> </td> </tr>"
    wireRows()
  }
}

function wireRows () {
  // get all input cells
  let rows = document.getElementsByClassName('input-cell')

  //iterate rows
  for (let i = 0; i < rows.length; i++) {
    let row = rows[i]

    // set event handlers
    row.onclick = FORM_HANDLERS.onClick
    row.addEventListener('focusout', FORM_HANDLERS.focusOut)
    row.addEventListener('keyup', FORM_HANDLERS.keyUp)
  }

  let addButton = document.getElementById('add-row-button')
  addButton.addEventListener('click', FORM_HANDLERS.addRow)

  let deleteButtons = document.getElementsByClassName('delete-row-button')
  for (let i = 0; i < deleteButtons.length; i++) {
    deleteButtons[i].addEventListener('click', function (event) {
      if (confirm('Are you sure you want to delete this row?')) {
        let parent = this.parentNode.parentNode
        parent.outerHTML = ''
        let tbody = document.getElementById('qdo-exclusions')
        cleanChildNodes(tbody)
        for (let j = 0; j < tbody.childNodes.length; j++) {
          let row = tbody.childNodes[j]
          cleanChildNodes(row)
          row.childNodes[0].textContent = j + 1
        }
      }
    })
  }
}
